import { IconButton, TextField, Stack } from '@mui/material';
import ClearIcon from '@mui/icons-material/Clear';
import { useSubtaskProps } from '.';

interface Props {
   index: number;
   arrayHelpers: FieldArrayRenderProps;
}

export const Subtask: React.FC<Props> = (props) => {
   const { stackProps } = useSubtaskProps({ index, arrayHelpers });
   return (
      <Stack {...stackProps}>
         <TextField {...field} {...fieldProps} />
         <IconButton {...xButtonProps}>
            <ClearIcon fontSize='small' />
         </IconButton>
      </Stack>
   );
};
